import './assets/styles.css';
import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

// Importera dina sidor
import Home from './components/Home.jsx';
import About from './components/About.jsx';
import Cv from './components/Cv.jsx';
import Portfolio from './components/Portfolio.jsx';
import Contact from './components/Contact.jsx';
import NotFound from './components/NotFound.jsx';

function App() {
  const [menuActive, setMenuActive] = useState(false);
  const [easterEggActive, setEasterEggActive] = useState(false); 
  const [inputSequence, setInputSequence] = useState(''); // FÃ¶r tangentbordsinput
  const [isModalOpen, setIsModalOpen] = useState(false); // ðŸ›‘ Lagt till fÃ¶r att fixa modal-glitch

  // Funktion fÃ¶r att toggla hamburgarmenyn
  const toggleMenu = () => {
    if (!isModalOpen) { // ðŸ›‘ FÃ¶rhindrar att menyn Ã¤ndras nÃ¤r modal Ã¤r aktiv
      setMenuActive(!menuActive);
    }
  };

  // PÃ¥skÃ¤gg 1: Klicka pÃ¥ logon fÃ¶r att byta bakgrund
  const handleLogoClick = () => {
    setEasterEggActive(!easterEggActive);
    document.body.style.backgroundImage = easterEggActive
      ? "none"
      : "url('/profile.jpg')";  
  };

  // PÃ¥skÃ¤gg 2: Lyssna efter tangentbordsinput
  useEffect(() => {
    const secretCode = '1337';

    const handleKeyDown = (event) => {
      setInputSequence((prev) => {
        const newSequence = prev + event.key;
        if (newSequence.includes(secretCode)) {
          alert('Grattis, du hittade ett pÃ¥skÃ¤gg! ðŸŽ‰');
          return ''; // Ã…terstÃ¤ll sekvensen
        }
        return newSequence; 
      });
    };

    window.addEventListener('keydown', handleKeyDown);

    return () => {
      window.removeEventListener('keydown', handleKeyDown);
    };
  }, []);

  // ðŸ›‘ Fix: Se till att modalens status hanteras korrekt
  const handleModalStateChange = (isOpen) => {
    setIsModalOpen(isOpen);
    if (isOpen) {
      setMenuActive(false); // ðŸ›‘ StÃ¤ng menyn om modalen Ã¶ppnas
    }
  };

  return (
    <Router>
      {/* Navigation */}
      <nav>
        <div className="nav-container">
          <div className="logo" onClick={handleLogoClick}>Mitt CV</div>
          <div className="hamburger" onClick={toggleMenu}>
            â˜°
          </div>
          <ul className={`nav-links ${menuActive ? 'active' : ''}`}>
            <li><Link to="/" onClick={() => setMenuActive(false)}>Hem</Link></li>
            <li><Link to="/about" onClick={() => setMenuActive(false)}>Om mig</Link></li>
            <li><Link to="/cv" onClick={() => setMenuActive(false)}>CV</Link></li>
            <li><Link to="/portfolio" onClick={() => setMenuActive(false)}>Portfolio</Link></li>
            <li><Link to="/contact" onClick={() => setMenuActive(false)}>Kontakt</Link></li>
          </ul>
        </div>
      </nav>

      {/* Routes */}
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/cv" element={<Cv />} />
        <Route path="/portfolio" element={<Portfolio setModalState={handleModalStateChange} />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="*" element={<NotFound />} />
      </Routes>
    </Router>
  );
}

export default App;
